import React from "react";

const NakedSingleComponent = (props) => {
  return <h2>naked single</h2>;
};

const check = (cell) => {
  if (cell.suspects.size === 1) {
    return cell.suspects.values().next().value;
  }
  return 0;
};

export const nakedSingle = {
  name: "Naked Single",
  check: (cell) => {
    if (cell.suspects.size === 1) {
      return cell.suspects.values().next().value;
    }
    return 0;
  },
};
